pragma solidity >=0.4.21 <0.7.0;

import "../libs/openzeppelin-solidity/contracts/ownership/Ownable.sol";
import "./SickFactory.sol";
import "../libs/openzeppelin-solidity/contracts/math/SafeMath.sol";

contract PatientFactory is Ownable {
    using SafeMath for uint256;

    event NewPatient(
        uint256 patientId,
        string name,
        string cmt,
        uint256 age,
        uint256 sex,
        bool living
    );
    event Transfer(address _from, address _to, uint256 _tokenId);
    struct Patient {
        uint256 patientId;
        string name;
        string cmt;
        uint256 age;
        uint256 sex;
        bool living;
    }

    Patient[] public patients;

    mapping(address => uint256) public OwnerToPatient; // nguoi dung->benh nhan.
    mapping(address => uint256) public OwnerPatientCount; //nguoi dung ->so benh nhan.
    mapping(uint256 => address) public PatientToOwner; //benh nhan ->nguoi dug

    modifier onlyOwnerOf(uint256 _patientId) {
        require(msg.sender == PatientToOwner[_patientId]);
        _;
    }
    function getSender() public view returns (address) {
        return msg.sender;

    }

    function CreatePatient(
        string memory _name,
        string memory _cmt,
        uint256 _age,
        uint256 _sex
    ) public {
        uint256 patientId = patients.length;
        uint256 id = patients.push(
            Patient(patientId, _name, _cmt, _age, _sex, true)
        ) -
            1;
        PatientToOwner[id] = msg.sender;
        OwnerPatientCount[msg.sender]++;
        emit NewPatient(id, _name, _cmt, _age, _sex, true);

    }

    function countPatient(address _owner) public view returns (uint256) {
        return OwnerPatientCount[_owner];

    }

    function _transfer(address _from, address _to, uint256 _tokenId) public {
        OwnerPatientCount[_to] = OwnerPatientCount[_to].add(1);
        OwnerPatientCount[msg.sender] = OwnerPatientCount[msg.sender].sub(1);
        PatientToOwner[_tokenId] = _to;
        emit Transfer(_from, _to, _tokenId);
    }

    function transferFrom(address _from, address _to, uint256 _tokenId) public {
        require(PatientToOwner[_tokenId] == msg.sender);
        _transfer(_from, _to, _tokenId);
    }

    function getPatientByOwner(address _owner)
        external
        view
        returns (uint256[] memory)
    {
        uint256[] memory result = new uint256[](OwnerPatientCount[_owner]);
        uint256 count = 0;
        for (uint256 i; i < patients.length; i++) {
            if (PatientToOwner[i] == _owner) {
                result[count] = i;
                count++;
            }
        }
        return result;
    }

}
